你能尝试使用一趟扫描实现吗？
解答
/**
 * Definition for singly-linked list.
 * function ListNode(val) {
 *     this.val = val;
 *     this.next = null;
 * }
 */
/**
 * @param {ListNode} head
 * @param {number} n
 * @return {ListNode}
 */
// 遍历节点存储到数组，索引到n然后删除
var removeNthFromEnd = function(head, n) {
    const nodes = []
    let node = head
    while (node) {
        nodes.push(node)
        node = node.next
    }

    const delIndex = nodes.length - n
    if (delIndex === 0) {
        return nodes[1] || null
    } else {
        nodes[delIndex - 1].next = nodes[delIndex].next
        return head
    }
};

